-- Volcando estructura para procedimiento monedas.spActualizarCambioMoneda
DROP PROCEDURE IF EXISTS `spActualizarCambioMoneda`;
DELIMITER //
CREATE PROCEDURE `spActualizarCambioMoneda`(
IN IdMoneda int,
IN Fecha date,
IN Cambio float
)
BEGIN
	IF EXISTS(SELECT *
				FROM CambioMoneda
					WHERE IdMoneda=IdMoneda
						AND Fecha=Fecha) THEN
		
		UPDATE CambioMoneda
			SET Cambio=Cambio
			WHERE IdMoneda=IdMoneda
				AND Fecha=Fecha;
	ELSE
			IdMoneda, Fecha, Cambio
			)
			VALUES(
			IdMoneda, Fecha, Cambio
			);
	END IF;
END//
DELIMITER ;

-- Volcando estructura para procedimiento monedas.spActualizarMoneda
DROP PROCEDURE IF EXISTS `spActualizarMoneda`;
DELIMITER //
CREATE PROCEDURE `spActualizarMoneda`(
IN IdMoneda int,
IN Moneda varchar(100),
IN Sigla varchar(5),
IN Simbolo varchar(5),
IN Emisor varchar(100)
)
BEGIN
	IF IdMoneda<=0 THEN
			Moneda, Sigla, Simbolo, Emisor
			)
			VALUES(
			Moneda, Sigla, Simbolo, Emisor
			);
	ELSE
		UPDATE Moneda
			SET Moneda=Moneda,
			Sigla=Sigla,
			Simbolo=Simbolo, 
			Emisor=Emisor
			WHERE Id =  IdMoneda;
	END IF;
END//
DELIMITER ;

